a1=A.ac('\u2022 Hizmetin Sunulmas\u0131: Namaz vakitlerini konumunuza g\xf6re hesaplamak, zikirlerinizi takip etmek ve kaydetmek.\n\n\u2022 Hesap Y\xf6netimi: Kimli\u011finizi do\u011frulamak, \u015fifre s\u0131f\u0131rlama i\u015flemlerini y\xfcr\xfctmek ve profilinizi y\xf6netmenizi sa\u011flamak.\n\n\u2022 Ki\u015fiselle\u015ftirme: "Asistan" \xf6zelli\u011finin sorular\u0131n\u0131za size \xf6zel (\xf6rne\u011fin isminizle hitap ederek) yan\u0131t vermesini sa\u011flamak ve ana ak\u0131\u015fta ilgi alanlar\u0131n\u0131za uygun i\xe7erikler sunmak.\n\n\u2022 \u0130leti\u015fim ve Bildirimler: Namaz vakti hat\u0131rlatmalar\u0131 ve g\xfcnl\xfck zikir hat\u0131rlatmalar\u0131n\u0131 (saat 22:00 gibi) size iletmek.\n\n\u2022 Geli\u015ftirme ve G\xfcvenlik: Uygulaman\u0131n hatalar\u0131n\u0131 tespit etmek, g\xfcvenli\u011fi sa\u011flamak ve kullan\u0131c\u0131 deneyimini iyile\u015ftirmek.\n\n\u2022 Reklam G\xf6sterimi: Premium \xfcye de\u011filseniz, size uygun reklamlar\u0131 sunabilmek.',b8,b8,b8,c2,b8,b8)
